class App extends Component { 

	constructor() { 
		super();
		AuthService.startAuthService();
	}

	render() { 
		return (
				<Grommet theme={grommet} full={true}>
					<Box alignContent='between' fill={true}>
						<View/>
					</Box>
				</Grommet>
		);
	}
};

export default App;
